import { cssTransition } from "react-toastify"

export default function Focused(props) {

  const renderFocusedList = () => {
    return props.focused.map((item, i) => (
      <div
        // type = "focused"
        style={{
          width: "calc(33vw - 17px)", 
          height: "27px", 
          backgroundColor: "#e8fefd",
          textAlign: "center",
          paddingTop: "3px",
          marginBottom: "5px"
        }} 
        onClick={(e) => {
          console.log(e)
          // if (e.target.style.height === "343px") {
          //   e.target.style.height = "27px"
          // }
        }}
        key={`F${i}`}
        >
          {item[0].resources[0].data.name}
      </div>
    ))
  }

  return (
    <div style={{
      overflowY: "scroll",
      overflowX: "hidden",
      position: "absolute", 
      width: "33vw", 
      height: "85.5vh", 
      left: "65.5vw",
      top: "13vh"
    }}>{renderFocusedList()}</div>
  )
}
